package com.salesianostriana.dam.ejerapirestmonumentos.model;import jakarta.persistence.Entity;import jakarta.persistence.GeneratedValue;import jakarta.persistence.Id;import lombok.*;@Entity@Getter@Setter@Builder@AllArgsConstructor@NoArgsConstructor@ToStringpublic class Monumento {    @Id @GeneratedValue    private Long id;    private String codPais;    private String nomPais;    private String localizacion;    private String nombre;    private String descripcion;    private String foto;}